class OpcaoJogadaUm {
    tipo;
    dados;
    total

    setTipo(tipo) {
        this.tipo = tipo
    }
    getTipo() {
        return this.tipo;
    }

    setDados(dados) {
        this.dados = dados;
    }
    getDados() {
        return this.dados;
    }

    setTotal(total) {
        this.total = total;
    }
    getTotal() {
        return this.total;
    }
}
